import React from "react";
import * as ReactDOMClient from "react-dom/client";
import ReactDOM from "react-dom";
import App from "./app";
import "./css/main.css";

// const app = ReactDOMClient.createRoot(document.getElementById("main"));
// app.render(<App />);

class Prog extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      users: ["Jack", "Max", "Leo", "Alex"],
    };
  }
  render() {
    return (
      <div>
        {this.state.users.map((el, index) => {
          // console.log(el, index + 1);
          return <div>{index + 1}:</div>;
        })}
        text
      </div>
    );
  }
}
export default Prog;

const link = ReactDOMClient.createRoot(document.getElementById("test"));
link.render(<Prog />);
